import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  text-align: center;
  padding: 50px;
  background-color: #f2f2f2;
`;

const Title = styled.h1`
  color: #2c3e50;
`;

const Button = styled.button`
  background-color: #3498db;
  color: white;
  padding: 12px 20px;
  border: none;
  border-radius: 8px;
  cursor: pointer;
`;

function App() {
  return (
    <Container>
      <Title>Bienvenue dans l'application de réservation d'hôtel</Title>
      <Button>Voir les hôtels</Button>
    </Container>
  );
}

export default App;
